import './App.css'

function List(rank,name,ratio,profit,avgprofit,per,price,action){
    return(
        <div className='list'>
      
        <div className="rank">{rank}</div>
        <div className="name">{name}</div>
        <div className="ratio">{ratio}</div>
        <div className="profit">{profit}</div>
        <div className="avgprofit">{avgprofit}</div>
        <div className="per">{per}</div>
        <div className="price">{price}</div>
        <div className="action">{action}</div>
  
      </div>
    )
}

export default List;
